import React from "react";


const Confirm = props => {
  const {paymentType,invoiceNo,patientName,amount,payerName,nicNo,contactNo,emailAddress,address} =
    (props.location && props.location.state) || {};
  return (
    <div>
      <NavLink to="/" activeClassName="active">
        Go Back
      </NavLink>
      <div className="form-details">
        <div>
          <strong>Payment Type:</strong> {paymentType}
        </div>
        <div>
          <strong>Invoice No.:</strong> {invoiceNo}
        </div>
        <div>
          <strong>Patient Name:</strong> {patientName}
        </div>
        <div>
          <strong>Amount:</strong> {amount}
        </div>
        <div>
          <strong>Payer Name:</strong> {payerName}
        </div>
        <div>
          <strong>NIC No:</strong> {nicNo}
        </div>
        <div>
          <strong>Contact No:</strong> {contactNo}
        </div>
        <div>
          <strong>Email Address:</strong> {emailAddress}
        </div>
        <div>
          <strong>Address:</strong> {contactNo}
        </div>
      </div>
    </div>
  );
};

export default Confirm;
